description:
Can you imagine getting to study anywhere, anytime, with complete and updated classes on your phone?
 
The EmÁudio Contests is an application that allows access to fully complete audio courses and updated with the same content and teaching of specialized books and classes in PDF.
 
The audio courses will help you:

1. learn new material more easily, because the audio courses function as true tutoring;

2. review more efficiently because it facilitates the attachment of the contents;

3. access updates as audio allows quick and convenient access to any change, novelty, and update the main case law of matter, without having to "spend" the study time reading judged enormous and complex; and,

4. increase the quality and optimization of studies, because finally now the students report that they can study even when you are tired!
 
Functionalities:
 
- Installation of custom lists, as the competition notice;
- Ability to listen to audio files at fast speed, optimizing your study time;
- Ability to play back the audio offline, not to consume your internet.
- Play in the background, allowing you to use other applications.
 
Just download the EmÁudio contests to participate in this revolution in studies!

AND EITHER

The National High School Exam (Enem) is a test taken by students in the last year of high school. This test is one of the ways to enter undergraduate courses.

With the ENEM application, you will be able to:

- View the race schedule;
- Monitor your registration;
- Monitor application for exemption from registration fee;
- Have access to notices and news;
- Check frequently asked questions and guidelines;
- View your grade and writing of previous Enem tests.

Important: You can only enroll in Enem through the site enem.inep.gov.br/participante. It is not possible to register through the application.
